css:
.gutter.linter-gutter-enabled .line-number.linter-warning:before {
  color: #ffbd2a;
}
.gutter.linter-gutter-enabled .line-number.linter-error:before {
  color: #f36f69;
}
.highlight.linter-error .region,
.highlight.linter-warning .region {
  opacity: 1;
  border: none;
}
.highlight.linter-warning .region {
  background: transparent;
}
.highlight.linter-error .region {
  background: #fbcdcb;
}
.editor .trailing-whitespace {
  background-color: #fbcdcb;
}
.editor,
.editor .gutter {
  background-color: #ffffff;
  color: #555555;
}
.editor .invisible-character {
  color: rgba(153, 153, 136, 0.15);
}
.editor .indent-guide {
  color: rgba(153, 153, 136, 0.15);
}
.editor .wrap-guide {
  background-color: rgba(153, 153, 136, 0.3);
}
.editor .gutter {
  color: #555555;
  background: #ffffff;
}
.editor .gutter .line-number.folded,
.editor .gutter .line-number:after,
.editor .fold-marker:after {
  color: #e87b00;
}
.editor .invisible {
  color: #555;
}
.editor .selection .region {
  background-color: #e1e1e1;
}
.editor.is-focused .cursor {
  border-color: #000000;
}
.editor.is-focused .selection .region {
  background-color: rgba(49, 143, 255, 0.1);
}
.editor.is-focused .line-number.cursor-line-no-selection,
.editor.is-focused .line.cursor-line {
  background-color: rgba(255, 255, 134, 0.34);
  background-color: rgba(153, 153, 136, 0.05);
}
.editor .comment {
  color: rgba(153, 153, 136, 0.75);
  font-style: italic;
}
.editor .string {
  color: #2da36e;
}
.editor .source .string .source,
.editor .source .string .meta.embedded.line {
  color: #00d073;
}
.editor .source .string .punctuation.section.embedded {
  color: #00d073;
}
.editor .source .string .punctuation.section.embedded .source {
  color: #00d073;
}
.editor .section.embedded.begin,
.editor .section.embedded.end {
  color: #703fde;
  font-weight: bold;
}
.editor .constant.numeric {
  color: #703fde;
}
.editor .constant.language {
  color: #703fde;
  font-weight: bold;
}
.editor .constant.symbol,
.editor .constant.character,
.editor .constant.other {
  color: #703fde;
}
.editor .constant.placeholder {
  color: #00d073;
}
.editor .constant.numeric.line-number.find-in-files .match {
  color: rgba(143, 190, 0, 0.63);
}
.editor .variable {
  color: #555555;
}
.editor .variable.parameter {
  font-style: italic;
}
.editor .variable.instance {
  color: #259ab7;
}
.editor .keyword {
  color: #318fff;
  font-weight: bold;
}
.editor .storage {
  color: #703fde;
  font-weight: bold;
}
.editor .storage.type {
  color: #703fde;
}
.editor .storage.fixme,
.editor .storage.todo {
  color: #f36f69;
}
.editor .storage.changed {
  color: #ffbd2a;
}
.editor .entity.name.class {
  text-decoration: underline;
}
.editor .entity.other.inherited-class {
  text-decoration: underline;
}
.editor .entity.name.function {
  color: #2c36e8;
  font-weight: bold;
}
.editor .entity.name.tag {
  color: #2c36e8;
  font-weight: bold;
}
.editor .entity.other.attribute-name {
  font-style: italic;
}
.editor .entity.name.filename.find-in-files {
  color: #E6DB74;
}
.editor .invalid {
  background-color: #fbcdcb;
}
.editor .meta.structure.dictionary.json > .string.quoted.double.json,
.editor .meta.structure.dictionary.json > .string.quoted.double.json .punctuation.string {
  color: #555555;
}
.editor .meta.structure.dictionary.value.json > .string.quoted.double.json {
  color: #2da36e;
}
.editor .meta.diff,
.editor .meta.diff.header {
  color: #75715E;
}
.editor .css.support.property-name {
  color: #2c36e8;
  font-weight: bold;
}
.editor .source.gfm {
  color: #444;
}
.editor .gfm .markup.heading {
  color: #111;
}
.editor .gfm .link {
  color: #888;
}
.editor .gfm .variable.list {
  color: #888;
}
.editor .markdown .paragraph {
  color: #444;
}
.editor .markdown .heading {
  color: #111;
}
.editor .markdown .link {
  color: #888;
}
.editor .markdown .link .string {
  color: #888;
}
.editor .search-results .marker .region {
  background-color: transparent;
  border: 1px solid #999999;
}
.editor .search-results .marker.current-result .region {
  border: 1px solid #000000;
}
.bracket-matcher {
  background-color: #C9C9C9;
  opacity: 0.7;
  border-bottom: 0 none;
}
